import Foundation
import SceneKit


func expandMoves(_ moves: String) -> [Int] {
    moves.compactMap { moveStringMap.firstIndex(of: $0) }
}

func compressMoves(_ moves: [Int]) -> String {
	String(moves.map { moveStringMap[$0] })
}

